import React from "react";

import auth0 from "../Lib/auth0";

const App = (props) => {
  return (
    <div>
      <h1>App</h1>
      <pre>{JSON.stringify(props, null, 2)}</pre>
    </div>
  );
};

export default App;

export async function getServerSideProps({ req, res }) {
  const session = auth0.getSession(req);
  console.log(session);
  return {
    props: {
      user: {
        name: "Rivanildo",
      },
    },
  };
}
